id. \"We're immature and we do argue over pointless things. But we're also just trying to have fun. We're working in a warehouse, it's not like we're curing cancer.\"</p><p><br></p><p>Kota sighed. \"I know,\" he said. \"But you can't just argue all the time. It's not productive. And it's not fun for anyone.\"</p><p>The workers thought about what Kota said. Then, they all nodded in agreement.</p><p><br></p><p>\"Okay,\" they said. \"We'll stop arguing.\"</p><p><br></p><p>And they did. The workers stopped arguing and started working together. And they were actually more productive when they worked together.</p><p><br></p><p>Kota was happy. He had finally fixed the problem with the workers. And he had done it without having to fire anyone.</p><p><br></p><p>Kota went back to his office and sat down at his desk. He was about to start playing video games when he got a call from his boss.</p><p><br></p><p>\"Kota,\" his boss said, \"I just wanted to thank you for fixing the problem with the workers. You did a great job.\"</p><p><br></p><p>\"Thanks,\" Kota said. \"I'm glad I could help.\"</p><p><br></p><p>Kota hung up the phone and smiled. He was a good Human Resources officer. He was good at fixing problems. And he was good at playing video games.</p><p><br></p><p>The end.</p><p><br></p><h3>Draft 2</h3><p><im src=\"img:110160279:img\"></p><p></p><div _ngcontent-ng-c1720846056=\"\" class=\"markdown\"><p>Kota was a flamboyant and inappropriate gamer who worked as a Human Resources officer at a local warehouse. The workers at the local warehouse were very immature and constantly arguing over pointless things. The company Kota worked for, Muyers Barket, also always made ridiculous demands of Kota. Kota's office was a small closet with a bucket.</p><p><br></p><p>One day, Kota was called into the office of the warehouse manager, Mr. Jenkins. Mr. Jenkins was a short, balding man with a bad temper.</p><p><br></p><p>\"Kota,\" Mr. Jenkins said, \"I'm having a problem with the workers. They're always arguing and fighting. I need you to do something about it.\"</p><p><br></p><p>\"Of course, Mr. Jenkins,\" Kota said. \"I'll take care of it.\"</p><p><br></p><p>Kota went back to his office and thought about what he could do. He knew that the workers were immature and that they would probably just laugh at him if he tried to give them a lecture. He also knew that Mr. Jenkins was a hard man to please.</p><p><br></p><p>Kota decided that the best way to handle the situation was to use humor. He went to the break room and got a bag of donuts. He then went to the workers' area and started handing out the donuts.</p><p><br></p><p>\"Hey, everyone,\" Kota said. \"I brought you some donuts.\"</p><p><br></p><p>The workers were surprised. They had never seen Kota be so friendly before.</p><p><br></p><p>\"Thanks, Kota,\" one of the workers said.</p><p><br></p><p>\"No problem,\" Kota said. \"I just wanted to show you that I care about you guys.\"</p><p><br></p><p>The workers started eating the donuts. Kota smiled. He knew that he had them now.</p><p><br></p><p>\"So,\" Kota said, \"I was talking to Mr. Jenkins, and he's concerned about the fighting that's been going on.\"</p><p><br></p><p>The workers stopped eating and looked at Kota.</p><p><br></p><p>\"I know that you guys are just immature,\" Kota said. \"But fighting is not the answer. There's a better way to solve your problems.\"</p><p>Kota paused for effect.</p><p><br></p><p>\"We can settle our differences with a game of Mario Kart,\" Kota said.</p><p><br></p><p>The workers laughed.</p><p><br></p><p>\"You're serious?\" one of the workers asked.</p><p><br></p><p>\"Of course I'm serious,\" Kota said. \"It's the perfect way to settle our differences. The winner gets to decide what we do for lunch.\"</p><p>The workers thought about it for a moment.</p><p><br></p><p>\"Okay,\" one of the workers said. \"Let's do it.\"</p><p><br></p><p>The workers set up a game of Mario Kart. Kota was the first to race. He quickly sped to the finish line, winning the game.</p><p>\"I told you I was the best,\" Kota said.</p><p><br></p><p>The workers groaned.</p><p><br></p><p>\"Fine,\" one of the workers said. \"What do you want for lunch?\"</p><p><br></p><p>\"Pizza,\" Kota said.</p><p><br></p><p>The workers agreed. They went to the break room and ordered pizza. They ate the pizza and then went back to work.</p><p><br></p><p>The fighting stopped after that. The workers still argued sometimes, but it was never as bad as it used to be. Kota was happy that he had been able to help. He knew that he was a good Human Resources officer, even if he did have a small office and a bucket.</p></div><p></p><p></p>","G":1683252144011}],"K":{"110160279":{"I":"craiyon_220027_neon_pink_gamer_office_bucket.png","J":[256,256],"K":"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAQAAAAEACAYAAABccqhmAAAgAElEQVR4Xuy9yXdjSXbmaSABEiA40+ch5siITIVyiExlSiqpVCmVSqUeatP/YO9r2+f0Ob3pXa96U4uuUlUqhxh9ojtnEgSn/n6fmT0YHkHA6XSPiIwk/NBJgsDDe/bMPrv3u9+9t/Hrmx+fhRGP0/xcI/501hj1qhCmwvToP7zks1d9/6SPueC0q7dN1a7+7GzwREM/nh1f/AmMybFedHp6Fqb01Tg91evjeJ2mD56ZboZGQ79MT4Upfed5vvJ4nqbxnXQdF/39TO/Pn/Wqxxj3Pp/7mAefP+5xetHEqd40/v2Trqm8X5NeO+rvE09vwkGv+vmT7t3Z2cmrXNZgdCcsgMY1AAyP71UAYOpEi1Ff+cHNvQaASRB8DQBjAfYaAK4EgGHS9LuqBXASzgKgMXUic0EWQEgAkKd1s3ltAYy/g9cAcA0AV1vjY9/9TQBAAxcgAcBZAgBMS6b2NQBMugPXAPCtAsDf3/rhaA6gum+TbtDU2AWI3zveiRz//qtiw6TpV7cAys+DAwg1DuC04Ah4rX3IBAAAwfFJfAPPT03J75cFwKPy9aYiD5B9z7NxJ/ASF3/NAYycvi8xcvElf/IcwDUAXDxXLgsAEIEnxwkAtNAb09P6igB3DQAXjfOkDWbC/lED5Jde+emF1wBwbQFcOGdeBgB4s10AfWEJnB4dV7t/ozkdzgQE7FHXAHANAKNG4FuPAvwxWACTzPjLon75+kkWOGHA8jV1F2AUACjeF6a0+08JAAQHIy2A6hz02sgWFCDxkhdknuGKYcRJH3UdBnyzFsh3FgDqlz3pRC8apqvG+VkekxbphXtLQo6LvMRJwOLPZXe/0M2Uea+/Wysg8u/sZBCzPdPiP2f+Yy2IEynNzrjAiOXr/fyYFnQ2jMeZqK96T8ZN6XML/ooAc3JFE30SQF3175Pi+N91FyFvHheNw6Tra1xkAXxfAGASRTQOBF4KAE60oGH+CwBgYWb/v75I6wssk6QAgEFgKlsDSYAlqdWbWOgXTZhrABgemWsASOPxqpPwdVgAV0H5awC43OhdA8A1AIycMd8WANjHvtwcrl49afFPOva1BTBwSV7xFoRrF+BlZuHFozt53Y2Porw2F+DCUzSJNeZxNj7O31Cs
